import re

long = """UUU F      CUU L      AUU I      GUU V
UUC F      CUC L      AUC I      GUC V
UUA L      CUA L      AUA I      GUA V
UUG L      CUG L      AUG M      GUG V
UCU S      CCU P      ACU T      GCU A
UCC S      CCC P      ACC T      GCC A
UCA S      CCA P      ACA T      GCA A
UCG S      CCG P      ACG T      GCG A
UAU Y      CAU H      AAU N      GAU D
UAC Y      CAC H      AAC N      GAC D
UAA Stop   CAA Q      AAA K      GAA E
UAG Stop   CAG Q      AAG K      GAG E
UGU C      CGU R      AGU S      GGU G
UGC C      CGC R      AGC S      GGC G
UGA Stop   CGA R      AGA R      GGA G
UGG W      CGG R      AGG R      GGG G """

regex = r"[A-Z][A-Z][A-Z]\ [A-Za-z]+"

elements = re.findall(regex,long)

map = {}

for element in elements:
	split = element.split(" ")
	map[split[0]] = split[1]

#Recurbot has failed. Analyze is an equivalent iterative procedure.
	
#####################################################################################################
def recurbot(string,constructed):                                                                  #
    if len(string) < 3 or string[:4] == "UAA" or string[:4] == "UAG" or string[:4] == "UGA":       #
        return constructed                                                                         #
    else:                                                                                          #
        singleton = re.findall(r"[A-Z][A-Z][A-Z]",string)                                          #
                                                                                                   #
        single = singleton[0]                                                                      #
        replace = map[single]                                                                      #
        constructed += replace                                                                     #
        return recurbot(string[3:],constructed)                                                    #
####################################################################################################

def analyze(string):
        counter = 0
        new_str = ""
        for x in range(len(string)/3):
                
                consider = string[counter:counter+3]
 
                if map[consider] == "Stop":
                        break
                else:
                        new_str += map[consider]
                counter = counter + 3
        return new_str
                
